        super(props)

        this.onChangeUsername = this.onChangeUsername.bind(this)
        
        this.onSubmit = this.onSubmit.bind(this)

        this.state={
            username: '',
            description: '',
            duration: 0,
            date: new Date(),
            users: []
        }

    }
    onChangeUsername(e){
        this.setState({
            username: e.target.value
        })
    }
    onSubmit(e){
        e.preventDefault()

        const user = {
